import React from "react";
import styled from "styled-components";

export default  function TableRow(){
    return(
        <tr>
        <td>
            <Img  src="./assets/images/chrome.png"/>
            <Para>Chrome<span>(12k)</span></Para>
        </td>
        <td>Francisco Chang</td>
        <td>Mexico</td>
      </tr>
    );
}


const Img = styled.img`
    margin-right: 1rem;
`;

const Para = styled.p`
     background
    &  span{
        color:#GB727D;
    }
`;
